import { NavLink } from "react-router-dom";
import '../css/Navbar.css'
import { useSelector } from "react-redux";

const navItem = [
  {
    pathName: "Home",
    path: "/",
  },
  {
    pathName: "Products",
    path: "/products",
  },
  {
    pathName: "About us",
    path: "/about",
  },
];

const Navbar = () => {
  const navList = navItem.map((item) => (
    <li key={item.path}>
      <NavLink to={item.path}>{item.pathName}</NavLink>
    </li>
  ));

  const state = useSelector(store => store.products)
  console.log(state)

  return(
    <nav>
        <section>
            <h3>Brand</h3>
        </section>
        <ul>
            {navList}
        </ul>
    </nav>
  )
};

export default Navbar;
